import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomeScreen from './screens/HomeScreen';
import RegisterScreen from './screens/RegisterScreen';
import WelcomeScreen from './screens/WelcomeScreen';
import LoginScreen from './screens/LoginScreen';
import ZodiacRoomsScreen from './screens/ZodiacRoomsScreen';
import RoomScreen from './screens/RoomScreen';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<WelcomeScreen />} />         {/* Pantalla de bienvenida */}
        <Route path="/register" element={<RegisterScreen />} /> {/* Registro */}
        <Route path="/login" element={<LoginScreen />} />       {/* Login */}
        <Route path="/home" element={<HomeScreen />} />         {/* Inicio tras login */}
      </Routes>
    </Router>
  );
}

export default App;
